import React from "react";
import { DashContainer, Body, BodyHead, BodyContent,  } from "./DashElements";

const Dash = () => {
  return (
    <>
      <DashContainer>
        <BarContainer>
          <Bar></Bar>
        </BarContainer>
        <Body>
          <BodyHead></BodyHead>
          <BodyContent></BodyContent>
        </Body>
      </DashContainer>
    </>
  );
};

export default Dash;
